def redundancy_remover(text=''):
    """Takes a long string of words, removes redundant words, and returns a sorted list."""
    big_long_string = text
    number_of_characters = len(big_long_string)
    big_long_list = big_long_string.strip().split()
    number_of_total_packages = len(big_long_list)
    big_long_reduced_list = sorted(list(set(big_long_list)))
    big_long_reduced_string = ' '.join(big_long_reduced_list)
    return big_long_reduced_string

